import Hero from "./Hero";
import Layout from "./Layout";
import Intro from "./Intro";
import Card2 from "./Card-2";
import Showcase from "./Showcase";

import ReactPageScroller from "react-page-scroller";

export default class App {
  render() {
    return (
      <Layout>
        <Hero />
        <Card2 />
        <Intro />
        <Showcase />
      </Layout>
    );
  }
}
